import {INPUT_1_DATA, INPUT_2_DATA, INPUT_3_DATA, INPUT_4_DATA, INPUT_5_DATA} from "../types"

const initialState ={
            uid: '',
            name: "",
            comment: "",
            classViewProperty: "",
            dbTable: ""
          }

const inputCreateNewData = (state = initialState, action) => {
    
    switch (action.type){
            
        case INPUT_1_DATA:
            return {
                ...state, 
                uid: action.payload
            }
        case INPUT_2_DATA:
            return {
                ...state, 
                name: action.payload
            }
        case INPUT_3_DATA:
            return {
                ...state, 
                comment: action.payload
            }
        case INPUT_4_DATA:
            return {
                ...state, 
                classViewProperty: action.payload
            }
        case INPUT_5_DATA:
            return {
                ...state, 
                dbTable: action.payload
            }
            
        default: 
            return state;
    }
}
export default inputCreateNewData
